import React from "react";

const Contacts = () => {
  return (
    <>
      <h2>Contacts</h2>
      <ul>
        {this.state.Contacts.map((item) => (
          <li key={item.id}>{item.name}</li>
        ))}
      </ul>
    </>
  );
};

export default Contacts;
